  StartTextEmpty: "\u0639\u0645\u0644 \u0631\u0627\u0626\u0639\u060C \u0644\u0642\u062F \u0623\u0643\u0645\u0644\u062A \u062C\u0645\u064A\u0639 \u0627\u0644\u0645\u0631\u0627\u062C\u0639\u0627\u062A \u0627\u0644\u062E\u0627\u0635\u0629 \u0628\u0643! \u0627\u0644\u0622\u0646 \u062D\u0627\u0646 \u0648\u0642\u062A \u062A\u0631\u0633\u064A\u062E \u0647\u0630\u0647 \u0627\u0644\u0645\u0639\u0631\u0641\u0629. \u0633\u062A\u062A\u0648\u0641\u0631 \u062F\u0648\u0631\u0629 \u0627\u0644\u0645\u0631\u0627\u062C\u0639\u0629 \u0627\u0644\u062A\u0627\u0644\u064A\u0629 \u0642\u0631\u064A\u0628\u064B\u0627. \u0641\u064A \u0647\u0630\u0647 \u0627\u0644\u0623\u062B\u0646\u0627\u0621\u060C \u0644\u0627 \u062A\u062A\u0631\u062F\u062F \u0641\u064A \u0625\u0636\u0627\u0641\u0629 \u0627\u0644\u0645\u0632\u064A\u062F \u0645\u0646 \u0627\u0644\u0628\u0637\u0627\u0642\u0627\u062A \u0644\u0645\u0648\u0627\u0635\u0644\u0629 \u0627\u0644\u062A\u0639\u0644\u0645.",
