  SettingTextHardChoiceDesc: "Quando voc\xEA escolhe uma op\xE7\xE3o dif\xEDcil, adianta o pr\xF3ximo hor\xE1rio de revis\xE3o. Um valor maior resulta em uma revis\xE3o mais adiantada. Recomendado: 1.",
  SettingTextWaitting: "Tempo Limite de Espera",
  SettingTextWaittingDesc: "O tempo limite de espera tem dois prop\xF3sitos: 1) Durante o per\xEDodo de espera, ele for\xE7a voc\xEA a gastar tempo revisando, contemplando e memorizando. 2) Mais importante, ele ajuda a diferenciar as op\xE7\xF5es com mais precis\xE3o. Voc\xEA perceber\xE1 que, quando tem alguma ideia sobre a resposta, se voc\xEA escolher a op\xE7\xE3o errada, seu tempo de penalidade se torna mais longo. Portanto, \xE9 mais prov\xE1vel que voc\xEA escolha a op\xE7\xE3o apropriada em vez de adivinhar aleatoriamente a quest\xE3o, pois essa adivinha\xE7\xE3o \xE9 altamente imprecisa. Por exemplo, quando voc\xEA n\xE3o tem certeza sobre a resposta, \xE9 melhor escolher a op\xE7\xE3o 'N\xE3o Tenho Certeza'. Caso contr\xE1rio, se voc\xEA escolher a op\xE7\xE3o 'Eu Sei', mas a resposta estiver errada, o tempo de espera ser\xE1 longo. Voc\xEA pode ajustar essa op\xE7\xE3o com base em sua pr\xF3pria situa\xE7\xE3o para estender ou encurtar a dura\xE7\xE3o do tempo limite de espera, ou pode desativ\xE1-lo completamente. Os valores recomendados para o tempo limite de espera devem ser o n\xFAmero de segundos que leva para voc\xEA se lembrar de uma palavra de seis letras dentro de tr\xEAs horas sem esquec\xEA-la."
