  SettingTextWaittingDesc: "Kufiri i pritjes ka dy q\xEBllime: 1) Gjat\xEB periudh\xEBs s\xEB pritjes, ju detyron t\xEB kaloni koh\xEB duke rip\xEBrs\xEBritur, menduar dhe kujtuar. 2) M\xEB e r\xEBnd\xEBsishmja, ndihmon n\xEB dallimin m\xEB t\xEB sakt\xEB t\xEB opsioneve. Ju do t\xEB vini re se kur keni nj\xEB ide p\xEBr p\xEBrgjigjen, n\xEBse zgjidhni opsionin gabim, koha e nd\xEBshkimit b\xEBhet m\xEB e gjat\xEB. Prandaj, \xEBsht\xEB m\xEB e mundur q\xEB t\xEB zgjidhni opsionin p\xEBrshtatsh\xEBm n\xEB vend t\xEB t\xEB vazhduarit rast\xEBsisht, pasi kjo supozim \xEBsht\xEB shum\xEB i pasakt\xEB. P\xEBr shembull, kur nuk jeni t\xEB sigurt n\xEB p\xEBrgjigje, \xEBsht\xEB m\xEB mir\xEB t\xEB zgjidhni opsionin 'Nuk jam i sigurt'. N\xEBse, nga ana tjet\xEBr, zgjidhni opsionin 'Un\xEB e di', por p\xEBrgjigja \xEBsht\xEB e gabuar, koha e pritjes do t\xEB jet\xEB e gjat\xEB. Mund t\xEB rregulloni k\xEBt\xEB opsion bazuar n\xEB situat\xEBn tuaj p\xEBr t\xEB zgjatur ose p\xEBr t\xEB shkurtuar koh\xEBn e kufirit t\xEB pritjes, ose mund ta \xE7aktivizoni krejt\xEBsisht. Vlerat e rekomanduara p\xEBr kufirin e pritjes duhet t\xEB jen\xEB numri i sekondave q\xEB ju duhen p\xEBr t\xEB kujtuar nj\xEB fjal\xEB me gjasht\xEB shkronja brenda tre or\xEBve pa e harruar at\xEB."
